import './App.css';
import {Routes, Route, Link} from 'react-router-dom';
import Profile from './Components/Pages/Profile';
import Swiper from './Swiper';

function App() {
  return (
    <div>
      <Link to="/profile">Profile</Link>
      <Routes>
        <Route path="/profile" element={<Profile/>} />
      </Routes>
      <Swiper/>
    </div>
  );
}

export default App;
